import React from "react";
import "./App.scss";

function App() {
  return (
    <div style="display: flex;">
      {/* <!-- Column --> */}
      <div
        style="
        flex: 1;
        /* Space between columns */
        margin: 0 8px;

        /* Layout each column */
        display: flex;
        flex-direction: column;
    "
      >
        {/* <!-- Cover --> */}

        {/* <!-- Content --> */}
        <div
          style="
            /* Take available height */
            flex: 1;
        "
        ></div>

        {/* <!-- Button sticks to the bottom --> */}
      </div>

      {/* <!-- Repeat with other columns --> */}
    </div>
  );
}

export default App;
